$(function() {

    var cx_button_close;

    function elementLoaded(el, cb) {
        if ($(el).length) {
            cb($(el));
        } else {
            setTimeout(function() {
                elementLoaded(el, cb)
            }, 200);
        }
    };

    elementLoaded('#c2chat_button', function(el) {
        $('.sticky-footer ul li').addClass('center-with-chat')
        setTimeout(function() {
            el.removeClass('cx-side-button-disabled');
        }, 1000);

        el.click(function() {
            setTimeout(function() {
                $('#chat-genesys-button').click();
            }, 100);
         
        });
    });

    $('.cx-widget').on('click', '.cx-button-close', function(){
        $('.cx-end-confirm').click();
        setTimeout(function() {
            $('.cx-button-close').click();
        }, 200);        
    });




});